import React from 'react';
import { Outlet, Link, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { 
  FiUser, FiDroplet, FiHome, FiLogOut,
  FiCalendar, FiBarChart2, FiCheckCircle
} from 'react-icons/fi';

const DashboardLayout = () => {
  const { user, logout } = useAuth();
  const location = useLocation();

  const getRoleIcon = () => {
    switch(user?.role) {
      case 'donor': return <FiUser className="h-5 w-5" />;
      case 'blood-bank': return <FiDroplet className="h-5 w-5" />;
      case 'ngo': return <FiCalendar className="h-5 w-5" />;
      case 'admin': return <FiBarChart2 className="h-5 w-5" />;
      default: return <FiUser className="h-5 w-5" />;
    }
  };

  const getRoleName = () => {
    switch(user?.role) {
      case 'donor': return 'Donor';
      case 'blood-bank': return 'Blood Bank';
      case 'ngo': return 'NGO';
      case 'admin': return 'Admin';
      default: return 'User';
    }
  };

  const navItems = {
    donor: [
      { name: 'Dashboard', path: '/dashboard/donor', icon: <FiHome /> },
      { name: 'Create Request', path: '#create-request', icon: <FiDroplet /> },
    ],
    'blood-bank': [
      { name: 'Dashboard', path: '/dashboard/blood-bank', icon: <FiHome /> },
      { name: 'Inventory', path: '#inventory', icon: <FiDroplet /> },
      { name: 'Requests', path: '#requests', icon: <FiCheckCircle /> },
    ],
    ngo: [
      { name: 'Dashboard', path: '/dashboard/ngo', icon: <FiHome /> },
      { name: 'Create Camp', path: '#create-camp', icon: <FiCalendar /> },
    ],
    admin: [
      { name: 'Dashboard', path: '/dashboard/admin', icon: <FiHome /> },
      { name: 'Users', path: '#users', icon: <FiUser /> },
      { name: 'Analytics', path: '#analytics', icon: <FiBarChart2 /> },
    ]
  };

  const currentNavItems = navItems[user?.role] || [];

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Sidebar */}
      <div className="hidden md:flex flex-col w-64 bg-white shadow-lg">
        <div className="p-6 border-b">
          <div className="flex items-center space-x-3">
            <div className="p-2 bg-red-100 rounded-lg">
              {getRoleIcon()}
            </div>
            <div>
              <h2 className="font-semibold text-gray-800">{user?.name}</h2>
              <p className="text-sm text-gray-600">{getRoleName()} Dashboard</p>
            </div>
          </div>
        </div>

        <nav className="flex-1 p-4">
          {currentNavItems.map((item) => (
            <Link
              key={item.name}
              to={item.path}
              className={`flex items-center space-x-3 px-4 py-3 rounded-lg mb-2 ${
                location.pathname === item.path
                  ? 'bg-red-50 text-red-700'
                  : 'text-gray-700 hover:bg-gray-100'
              }`}
            >
              {item.icon}
              <span>{item.name}</span>
            </Link>
          ))}
        </nav>

        <div className="p-4 border-t">
          <button
            onClick={logout}
            className="flex items-center space-x-3 w-full px-4 py-3 text-gray-700 hover:bg-gray-100 rounded-lg"
          >
            <FiLogOut />
            <span>Logout</span>
          </button>
        </div>
      </div>

      {/* Main Content */}
      <div className="md:ml-64">
        <div className="p-6">
          <Outlet />
        </div>
      </div>
    </div>
  );
};

export default DashboardLayout;
